import React from 'react'
import { useHistory } from "react-router-dom";

const Home = () => {
    let history = useHistory();

    function handleClick() {
        history.push("/app");
    }

  return (
    <div>
          <button onClick={handleClick}> Go to Home </button>
    </div>
  )
}

export default Home
